import React, { useState } from "react";

import Carousel, {
  arrowsPlugin,
  slidesToShowPlugin,
} from "@brainhubeu/react-carousel";
import "@brainhubeu/react-carousel/lib/style.css";
import ClientLogoItem from "./ClientLogoItem";
import { BackArrowIcon, NextArrowIcon } from "../Icons/ArrowIcons";

function ClientsCarousel() {
  const [slides] = useState([
    {
      image: "/assets/clients/Rectangle 29.png",
    },
    {
      image: "/assets/clients/Rectangle 30.png",
    },
    {
      image: "/assets/clients/Rectangle 31.png",
    },
    {
      image: "/assets/clients/Rectangle 32.png",
    },
    {
      image: "/assets/clients/Rectangle 33.png",
    },
  ]);

  return (
    <>
      <Carousel
        slides={slides.map((value, id) => (
          <ClientLogoItem key={id} {...value} />
        ))}
        plugins={[
          {
            resolve: arrowsPlugin,
            options: {
              arrowLeft: <BackArrowIcon />,
              arrowRight: <NextArrowIcon />,
              addArrowClickHandler: true,
            },
          },
          {
            resolve: slidesToShowPlugin,
            options: {
              numberOfSlides: 4,
            },
          },
        ]}
      />
    </>
  );
}

export default ClientsCarousel;
